def binary_search(ls, target):
    left = 0
    right = len(ls) - 1

    while left <= right:
        mid = (left + right) // 2
        if ls[mid] == target:
            return mid
        elif ls[mid] < target:
            left = mid + 1
        else:
            right = mid - 1
    print("未查询到数据")
    return -1

